using System.Net.Security;
using System.Numerics;

namespace deck_of_cards
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Dealer dealer = new Dealer();

            dealer.Work();
        }
    }

    class Player
    {
        private List<Card> _takenCards = new List<Card>();

        public void TakeCard(Card card)
        {
            InfoMessage massage = new InfoMessage();

            _takenCards.Add(card);
        }

        public void Show()
        {
            foreach (var cardItem in _takenCards)
            {
                Console.WriteLine(cardItem.Suit + " " + cardItem.Rank);
            }
        }
    }

    class Card
    {
        public Card(string suit, string rank)
        {
            Suit = suit;
            Rank = rank;
        }

        public string Suit { get; private set; }
        public string Rank { get; private set; }
    }

    class Dealer
    {
        private InfoMessage _message = new InfoMessage();
        private List<Card> _cards = new List<Card>();
        private Player _player = new Player();

        public Dealer()
        {
            Create();
            Shuffle();
        }

        public void Work()
        {
            bool isWorking = true;
            int numbersOfCard;

            Console.WriteLine("–ö–∞—Ä—Ç—ã –≤ –∫–æ–ª–æ–¥–µ:");
            ShowCards();
            Console.WriteLine($"\n–ö–∞—Ä—Ç—ã —É –∏–≥—Ä–æ–∫–∞:");
            _player.Show();

            while (isWorking)
            {
                Console.WriteLine("–í–≤–µ–¥–∏—Ç–µ —Å–∫–æ–ª—å–∫–æ –∫–∞—Ä—Ç –¥–∞—Ç—å –∏–≥—Ä–æ–∫—É:");
                bool isNumber = int.TryParse(Console.ReadLine(), out numbersOfCard);

                if (isNumber == false)
                {
                    Console.WriteLine("–ù–µ–æ–±—Ö–æ–¥–∏–º–æ –≤–≤–µ—Å—Ç–∏ —á–∏—Å–ª–æ.");
                    Console.ReadKey();
                    Console.Clear();
                }
                else if (numbersOfCard <= 0 || numbersOfCard > _cards.Count)
                {
                    Console.WriteLine($"–ù–µ–æ–±—Ö–æ–¥–∏–º–æ –≤–≤–µ—Å—Ç–∏ –ø–æ–ª–æ–∂–∏—Ç–µ–ª–Ω—å–Ω–æ–µ —á–∏—Å–ª–æ, —á—Ç–æ–±—ã –æ–Ω–æ –Ω–µ –ø—Ä–µ–≤—ã—à–∞–ª–æ {_cards.Count}.");
                    Console.ReadKey();
                    Console.Clear();
                }
                else
                {
                    for (int i = 0; i < numbersOfCard; i++)
                    {
                        _player.TakeCard(GiveCard());
                    }

                    Console.Clear();

                    Console.WriteLine("–ö–∞—Ä—Ç—ã –≤ –∫–æ–ª–æ–¥–µ:");
                    ShowCards();
                    Console.WriteLine($"\n–ö–∞—Ä—Ç—ã —É –∏–≥—Ä–æ–∫–∞:");
                    _player.Show();

                    Console.ReadKey();
                    _message.EndGame();
                }
            }
        }

        public Card GiveCard()
        {
            Card card = _cards[_cards.Count - 1];
            _cards.Remove(card);
            return card;
        }
        public void ShowCards()
        {
            foreach (var cardItem in _cards)
            {
                Console.WriteLine($"{cardItem.Suit}  {cardItem.Rank}");
            }
        }

        public void Create()
        {
            string[] ranks = { "2", "3", "4", "5", "6", "7", "8", "9", "10", "Jack", "Queen", "King", "Ace" };
            string[] suits = { "Clubs", "Hearts", "Diamonds", "Spades" };

            for (int i = 0; i < suits.Length; i++)
            {
                for (int j = 0; j < ranks.Length; j++)
                {
                    _cards.Add(new Card(suits[i], ranks[j]));
                }
            }
        }

        private void AddRange()
        {
            Stack<Card> cards = new Stack<Card>();

            foreach (var card in _cards)
            {
                cards.Push(card);
            }
        }

        private void Shuffle()
        {
            Random random = new Random();

            for (int j = _cards.Count - 1; j >= 1; j--)
            {
                int NumberOfRandomCard = random.Next(1, _cards.Count - 1);
                Card tempCard = _cards[NumberOfRandomCard];
                _cards[NumberOfRandomCard] = _cards[j];
                _cards[j] = tempCard;
            }

            AddRange();
        }
    }

    class InfoMessage
    {
        public void EndGame()
        {
            Console.WriteLine("–î–æ —Å–∫–æ—Ä—ã—Ö –≤—Å—Ç—Ä–µ—á.");
            Console.ReadKey();
            Environment.Exit(0);
        }
    }
}

