import java.util.Scanner;
import java.util.InputMismatchException;
import static java.lang.Math.random;

public class EX22
{
    public static void main(String[] args) 
    {
        try 
        {
            // Instanciacao
            Scanner ent = new Scanner(System.in);
            
            // Programa
            cartelaJogos(qtdJogo(ent));
        }
        
        catch (InputMismatchException e) 
        {
            System.out.println("# Valor invalido");                                
        }
    }  

    private static int qtdJogo(Scanner ent)
    {
        System.out.print("# Quantidade de jogos: ");
        
        return ent.nextInt();
    }
    
    private static void cartelaJogos(int qtd)
    {
        int cont = 0;
        
        while (qtd > 0)
        {
            System.out.printf("\n***** CARTELA [%d] *****\n", cont + 1);

            // Estrutura de repetica: Formacao das cartelas
            for (int i = 0; i < 6; i++) 
            {
                System.out.printf("\n# Numero [%d]: %d", (i + 1), (int) (1 + random() * 60));
            }
            System.out.println("\n---------------------------------------------");
            
            // Controle
            qtd --;
            cont ++;
        }
    }
}

// ==UserScript==
// @name         YouTube Video Skipper
// @namespace    YouTube_K
// @version      0.1
// @description  Skip a specific number of minutes in a YouTube video when pressing the "s" key
// @author       _
// @match        https://www.youtube.com/watch?v=*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // Set the number of minutes to skip when pressing "s" key
    const minutesToSkip = 5; // Change this to your desired number of minutes

    // Listen for key press events
    document.addEventListener("keydown", function(event) {
        // Check if the pressed key is "s" key
        if (event.key === "s") {
            // Find the video element
            const videoElement = document.querySelector("video");

            if (videoElement) {
                // Calculate the target time to skip to
                const targetTime = videoElement.currentTime + (minutesToSkip * 60);

                // Set the current time of the video to the target time
                videoElement.currentTime = targetTime;

                // Prevent the default action of the "s" key (e.g., scrolling)
                event.preventDefault();
            }
        }
    });
})();

async function attachEvents() {

    const endPoints = {
        posts: 'http://localhost:3030/jsonstore/blog/posts',
        comments: 'http://localhost:3030/jsonstore/blog/comments'
    }
    const elUl = document.getElementById('post-comments');
    const elP = document.getElementById('post-body');
    const elH1 = document.getElementById('post-title');
    const selectMenu = document.getElementById('posts');
    const loadBtn = document.getElementById('btnLoadPosts');
    loadBtn.addEventListener('click', load);
    const viewBtn = document.getElementById('btnViewPost');
    viewBtn.addEventListener('click', view);
    let data;

    async function load(event) {
        let loadResponse = await fetch(endPoints.posts);
        let dataPosts = await loadResponse.json();
        data = dataPosts;

        for (let el of Object.values(dataPosts)) {
            let title = '';
            for (let i = 0; i < el.title.length; i++) {
                title += el.title[i];
            }
            let elOption = document.createElement('option');
            elOption.value = `${el.id}`;
            elOption.textContent = title;
            selectMenu.appendChild(elOption);
        }
    }

    async function view(event) {
        let viewData = await getPatch(endPoints.comments)

            elUl.innerHTML = '';
        let selectedPost = selectMenu.value;
       let text=selectMenu.options[selectMenu.selectedIndex].text


        let post=Object.values(data).find(el=>el.title===text)
        let comments=Object.values(viewData).filter(c=>c.postId===selectedPost)
        
        elH1.textContent =text;
        elP.textContent = post.body;
        for (const el of comments) {
                let elLi = document.createElement('li');
                elLi.setAttribute('id', `${el.id}`);
                elLi.textContent = el.text;
                elUl.appendChild(elLi);
        }
    }

}

async function getPatch(url){
    const response= await fetch(url)
    return response.json()
}
attachEvents();

